INSERT INTO `relojes` VALUES(623, 'GN134', 'Space People', 1, '', '2012-04-04', '2012-04-04', 0, 0, 4, 4, NULL, NULL, 11, 0, b'0', 0, 0, NULL, ' \n  Spangled with spaceships, clouds, rockets, and stars, this Swatch art special by the fanciful French designer Jean-Charles de Castelbajac is a wearable piece of the heavens. Vibrating with the music of the spheres, nostalgic and as magical as a child’s drawings, Space People (GN134), is an eye-catching strip of fantasy. Sea green UFOs, cool blue clouds, rose-coloured planets, and yellow moons seem to burst into view from a field of white space. A simple dial with four fields of colour balances the motion-studded strap. With its whimsy, magic, picture-book colours and dreamy conceits, this piece of fantasy captures Swatch—on a cosmic scale!  \n', b'0', b'0', b'0');
