INSERT INTO `relojes` VALUES(697, 'GJ112', 'Bestione', 1, '', '2012-04-04', '2012-04-04', 0, 0, 4, NULL, NULL, NULL, 12, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(698, 'GR121', 'Monster Time', 1, '', '2012-04-04', '2012-04-04', 0, 0, 4, 5, NULL, NULL, 12, 0, b'0', 0, 0, NULL, ' \n  A piece for Swatch was the perfect opportunity for the ever-provocative Kenny Scharf, whose boundary-pushing work and sense of humour were a natural fit with the spirit of the brand. In Monster Time (GR121), Scharf makes an amusingly fierce animal out of the watch format, with bright lizard green lines trailing through the strap like tracks in the sand left by a snake. The dial, which barely contains the red-eyed visage of a toothy monster, is grasped by red plastic, and the hands rotate irreverently around the beast’s grumpy face. The equally entertaining Fiz N’ Zip (GN164) offers childlike whimsy with a wicked edge—grinning blue and yellow creatures.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(699, 'GB156', 'Twelve Apostles', 1, '', '2012-04-04', '2012-04-04', 0, 0, 4, 6, NULL, NULL, 12, 0, b'0', 0, 0, NULL, ' \n  Kostabi’s Twelve Apostles (GB156) sit arrayed around the dial, one for each hour. Shadowed, streamlined and mysterious, they exhibit a mixture of emotional timbres. While some appear to be engaged in contemplation or prayer, others brood, and one hides beneath a noir-esque fedora. Half pop art-inspired screen prints, half expressive everymen, the apostles are inked in intense colour—turquoise, crimson, sage and canary. The strap is chequered with further images of the figures in slightly different poses, alternated with squares of transparent plastic. Bold, iconographic and intriguing, this piece for Swatch is a thought-provoking work.  \n', b'0', b'0', b'0');
