INSERT INTO `relojes` VALUES(783, 'GR128', 'Mr Watson', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, NULL, NULL, NULL, 13, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(784, 'GK715', 'Moos', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, NULL, NULL, NULL, 13, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(785, 'LG113', 'Madeleine', 1, '', '2012-04-05', '2012-04-05', 0, 0, 5, NULL, NULL, NULL, 13, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(786, 'GK207', 'Flowers', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 7, NULL, NULL, 13, 0, b'0', 0, 0, NULL, ' \n  Flowers (GK207) is as full of glitter, glamour, and shimmer as a spotlit stage. Dreamy and performative, the piece sweeps across the wrist with floral grace. In this effortlessly chic watch, Kemp employs the transparent Swatch plastic to create an ethereal mood, and lines the strap with drawn moments of whimsy, stardust, eye-shadow blue and hand-scrawled words. At the centre of the piece, a handsome face looks back at the wearer from underneath a hand-written “Amore,” stretched across the top of the dial. Light, elegant and fantastical, this window into the artist’s imagination is as breathtaking and poised as his acclaimed work in his native medium.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(787, 'GL106', 'Enchanting Forest', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 8, NULL, NULL, 13, 0, b'0', 0, 0, NULL, ' \n  Enchanting Forest (GL106), Licata’s design for Swatch, is inked with rows of tree-like figures, each of which shines with calligraphic elegance. These sea green, sky-blue, and twilight-purple silhouettes are lined on the left with red shadows, a visual touch that implies a setting or rising sun, low to the horizon to the right of the image. This suggestion of light-and-shade brings a sense of the outdoors to the arboreal scene. A translucent green case around the dial draws out the greens in the pattern, while the red buckle reiterates the red shadows of the tree forms, bringing out the stylish wilderness of this work by a master printmaker.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(788, 'GB166', 'Temps Zero', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 9, NULL, NULL, 13, 0, b'0', 0, 0, NULL, ' \n  Temps Zero (GB166), heartily coloured in cadmium red, yellow, black and blue, has the visual advantage of snapping up attention through sheer intensity of colour. The dial has the hint of a human face, an implied bridge of the nose and two orbs that could be eyes. With its ambiguous central image, the watch could equally be pure formal composition, resounding with a beauty that only subtly references the light and forms of the natural world. With abstract grace and poise, this Swatch Art Special is an audacious balancing act of form and colour, a truly modern painting at the wrist.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(789, 'GK206', 'Vive La Paix', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 10, NULL, NULL, 13, 0, b'0', 0, 0, NULL, ' \n  Vive La Paix (GK206) is as sweet and lazy as a summer day. Painterly images of birds and the sun float in white on a deep azure strap like clouds passing across the sky.&nbsp; A brilliant and shimmering hue, the strap is rendered in signature Swatch plastic, with a clear plastic case around the dial. The dial, an easy field of cornflower blue, is empty of numbers except for a 3 at the right.&nbsp; To the left sits a friendly print of a hen in the sun, a warm scene from a country farmyard. This Swatch Art Special from Dutch artist Corneille seems made of whimsy and summer, the perfect complement to a dreamy afternoon.&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(790, 'GK208', 'Graphickers', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 11, NULL, NULL, 13, 0, b'0', 0, 0, NULL, ' \n  In Graphickers (GK208), Hajime Tachibana plays a clever melody on the keyboard of typography, using printed, stretched, coiled and distorted fonts as visual elements in the design. The strap is clear plastic, so that the type and words—“Swatch Graphickers”—pop against whatever background is placed behind the watch.&nbsp; The white dial is inked with an intricate, tangled design of black lines that almost look like traces of some object’s trajectory, a record of movement. Lines that curve and twist suggest shell-like, architecturally structured forms. The b&amp;w palette is perfect for this minimalist designer, whose urbane tastes define his point of view.&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(791, 'GG138', 'Blue Pasta', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 12, NULL, NULL, 13, 0, b'0', 0, 0, NULL, ' \n  Blue Pasta (GG138) is conceptual and sensuous in the same moment. A blue-tinted photographic image of elbow macaroni, luminescent as a silver gelatine print, extends the length of the strap. The image is both amusing and gorgeous, due to the shine of specular highlights and the mysterious banks of darkness between the macaroni. The dial, white with black script, directs the viewer to follow the steps of a recipe for blue-dyed pasta, and the hands are a knife, fork and spoon. An aesthetically convincing, ironic and thought-provoking piece, Miralda’s Blue Pasta is a sophisticated and witty contribution to the story of Swatch and Art.&nbsp;&nbsp;&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(792, 'GB169', 'Original Black', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, NULL, NULL, NULL, 14, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
