INSERT INTO `relojes` VALUES(829, 'LB140', 'Thriller', 1, '', '2012-04-05', '2012-04-05', 0, 0, 5, NULL, NULL, NULL, 14, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(830, 'GB733', 'My Way', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, NULL, NULL, NULL, 14, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(831, 'GK214', 'Lens Heaven', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 13, NULL, NULL, 14, 0, b'0', 0, 0, NULL, ' \n  Lens Heaven (GK214) has a secret that it may or may not reveal. A matt, chrome-coloured strap is stubbled with lens-like bubbles, which upon closer inspection yield scenes of intense colour and hushed elegance reminiscent of hand-painted miniatures. The watch glass is fitted with six magnifying lenses that draw the eye to colourful, everyday objects on the dial. Bright, sleek and subtle by turns, the work’s light body and barely-there feeling capture a signature characteristic of Swatch. Boym’s understated, impeccable style gives this piece both a light-hearted air and quiet dignity and presence.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(832, 'GN163', 'Boxing', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 14, NULL, NULL, 14, 0, b'0', 0, 0, NULL, ' \n  Boxing (GN163), Arroyo’s piece for the Swatch &amp; Art Collection, is an invitation to step into the ring for a 15-rounder with a heavy-handed cartoon kangaroo. This amusing character punches well above his weight—his fists are set like he’s ready to right-hook time into the future. Waving the colours of the Spanish flag, Arroyo’s creation is a frank, funny and creative expression featuring back-to-basics primary colours and a firetruck-red strap offset by a Superman-blue buckle and yellow loop. With its charming, children’s book image of a pugilist kangaroo whose boxing gloves indicate the time, this Swatch Art Special is a knockout!&nbsp;&nbsp;&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(833, 'GN164', 'Fiz N Zip', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 5, NULL, NULL, 14, 0, b'0', 0, 0, NULL, ' \n  A piece for Swatch was the perfect opportunity for the ever-provocative Kenny Scharf, whose boundary-pushing work and sense of humour were a natural fit with the spirit of the brand. In Monster Time (GR121), Scharf makes an amusingly fierce animal out of the watch format, with bright lizard green lines trailing through the strap like tracks in the sand left by a snake. The dial, which barely contains the red-eyed visage of a toothy monster, is grasped by red plastic, and the hands rotate irreverently around the beast’s grumpy face. The equally entertaining Fiz N’ Zip (GN164) offers childlike whimsy with a wicked edge—grinning blue and yellow creatures.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(834, 'GG140', 'Cheick Nadro', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 15, NULL, NULL, 14, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(835, 'GJ116', 'Wanayarra Tjukurrpa', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 16, NULL, NULL, 14, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(836, 'GJ117', 'Wild Laugh', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 17, NULL, NULL, 14, 0, b'0', 0, 0, NULL, ' \n  Yue Minjun has roped and harnessed the age-old power of the icon. In his paintings and sculptures, as in Wild Laugh (GJ117), his work for Swatch, Yue seizes attention with arresting images of frozen, mask-like laughter. The dial displays four of the artist’s trademark laughing, disembodied faces at hours 3, 6, 9 and 12. The blue plastic strap of this clever piece is spangled with red stars, and the dial’s hour and minute hands take up the flag-blue from the strap. Dripping with irony, this caustic work presents and criticizes a perceived uniformity and lack of originality, itself walking the taut tightrope between the two with gravity-defying poise.  \n', b'0', b'0', b'0');
