INSERT INTO `relojes` VALUES(873, 'GB168', 'Film No 4', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 18, NULL, NULL, 14, 0, b'0', 0, 0, NULL, ' \n  Yoko Ono’s art for Swatch is at once mutely, understatedly elegant and delightfully provocative. Despite its aloof, greyscale beauty, on closer inspection it pictures a film-reel series of images of a derriere. Titled Film No. 4 (GB168), the watch recalls Ono’s highly original and fiercely uncompromising work, where her use of the body in black and white photography and film defined her revolutionary perspective. The dial’s white letters, unscrambled, spell the artist’s name. Rendered in silver, black and white with vellum-like transparency, the watch has a celluloid quality, a strip of film taken right off the projector of a Manhattan art gallery.  \n', b'0', b'0', b'0');
