INSERT INTO `relojes` VALUES(988, 'GK270', 'Stiletto', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 33, NULL, NULL, 16, 0, b'0', 0, 0, NULL, ' \n  Stiletto (GK270), is like a party to which tattoos, graffiti, Mexican street graphics, auto-body art, cartoons and punk subculture have all been invited. With his wicked sense of humour and his gift for rendering, the edgy artist brings an arch, one-eyebrow-raised, generous dose of irony to the wrist. The stylish result of this meeting of minds directs attention to itself through a bright cactus-green strap and contrasting coral-orange dial, which exhibits a stylized image of the iconic high-fashion ladies’ shoe, surrounded by graffiti stars and pierced by five swords. Funny and hip, this work for Swatch displays a fierce street spirit.  \n', b'0', b'0', b'0');
