INSERT INTO `relojes` VALUES(1038, 'GK280', 'Agatic Agatac', 1, '', '2012-04-05', '2012-04-05', 0, 0, 4, 36, NULL, NULL, 16, 0, b'0', 0, 0, NULL, ' \n  Agatic Agatac (GK280) condenses the intensity of this popular designer’s vision into a small piece of her coloured imagination, barely contained in the classic Swatch format. A series of mosaic-shaped, rough squares of colour, carefully cherry-picked and assembled to evoke feeling, sits along a yellow plastic strap. Almost scratchily inked, the squares have a crayon quality that leaves space in the midst of intensity and summons thoughts of childhood. The dial is inked in the same print, and the hands are a delicate, ladylike pink. The work offers ample evidence of the artist’s gift for colour and her knack for the visually surprising.  \n', b'0', b'0', b'0');
