INSERT INTO `relojes` VALUES(1341, 'GK376', 'Blue Painted Time', 1, '', '2012-04-06', '2012-04-06', 0, 0, 4, 39, NULL, NULL, 20, 0, b'0', 0, 0, NULL, ' \n  Dean’s Painted Time (GK376-GK380) series shows off a spectrum of saturated hues that dress the wrist with colour. The set of watches, which includes five models (Blue-, Red-, Orange-, Green-, and Yellow- Painted Time), was conceived by the artist as an assemblage of Plexiglass coloured blocks fitted on a silver industrial ladder. In the final product, strips of colour are separated at intervals by gaps of transparent plastic. These very Swatch, very painterly pieces have two-tone colour plastic cases and dials and reveal a glimpse of the watchworks through the dials. The original Special Packaging features a silver Plexiglas box signed by the artist.  \n', b'0', b'0', b'0');
