INSERT INTO `relojes` VALUES(1810, 'PWN106', 'Blub Blub', 1, '', '2012-05-01', '2012-05-01', 0, 0, 19, NULL, NULL, NULL, 10, 0, b'0', 0, 0, NULL, ' \n  The splashy series created by master colourist, illustrator, and comic artist Massimo Giacon takes the art of watch design to a new level. Brimming with joy, jumping with colour and buzzing with humour, his fresh and attractive watches are peopled with comic figures, graphic flourishes and visual tricks that tease and please the eye. This multi-talented artist’s diverse background is unmistakable in these works, which creatively rework pop themes and images, mixing them up with repeated, interlacing forms, snatches of text and motifs in a range of scales. Even the names are evidence of the artist’s sheer exuberance - Gulp!!! (GK139), Crash!!! (GG111), Blub Blub (PWN106), Chicchirichi (GR112), Lady Octopus (PWK150), Meeoow (PWK156)...  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(1811, 'PWK156', 'Meeooow', 1, '', '2012-05-01', '2012-05-01', 0, 0, 19, NULL, NULL, NULL, 10, 0, b'0', 0, 0, NULL, ' \n  The splashy series created by master colourist, illustrator, and comic artist Massimo Giacon takes the art of watch design to a new level. Brimming with joy, jumping with colour and buzzing with humour, his fresh and attractive watches are peopled with comic figures, graphic flourishes and visual tricks that tease and please the eye. This multi-talented artist’s diverse background is unmistakable in these works, which creatively rework pop themes and images, mixing them up with repeated, interlacing forms, snatches of text and motifs in a range of scales. Even the names are evidence of the artist’s sheer exuberance - Gulp!!! (GK139), Crash!!! (GG111), Blub Blub (PWN106), Chicchirichi (GR112), Lady Octopus (PWK150), Meeoow (PWK156)...  \n', b'0', b'0', b'0');
