INSERT INTO `relojes` VALUES(2460, 'SLR100', 'Fandango', 1, 'Melody by Jean Michel Jarre', '2012-05-17', '2012-05-17', 0, 0, 24, NULL, NULL, NULL, 12, 0, b'0', 0, 0, NULL, ' \n  Mendini’s work for Swatch evokes the breezy, maritime, sun-on-skin feeling of lounging at the beach—even when his design is of a cityscape. Rendered in sugar-frosting pinks and purples, sprinkled with beach-umbrella reds and yellows, and generally favouring a palette of tropical blue-greens and pastels, these deliciously relaxed and easy-going watches are impeccably designed. Each one is a unique and pleasant expression with a feeling all its own. Cosmesis (GM103), Metroscape (GN109), Lots of Dots (GZ121), Fandango (SLR100), and Mendini Tower (GZS02) are imbued with the effortless, casual, unhurried spirit of the designer’s style. Miami? The Riviera? Either way, it feels amazing.  \n', b'0', b'0', b'0');
