INSERT INTO `relojes` VALUES(2991, 'GZ100', 'Modele Avec Personnages', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 52, NULL, NULL, 3, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(2992, 'GZ103', 'Mille Pattes', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 52, NULL, NULL, 3, 0, b'1', 0, 0, NULL, ' \n  Each of these Keith Haring watches snaps, crackles, and pops with the energy of 1980s New York. With irresistible designs and unexpected juxtapositions of colour--turquoise with avocado, apricot with bubblegum—they pulse to the rhythm of the streets. As exciting, original, and authentic as street-corner breakdancers, subway murals, and alley graffiti, these works attract attention like the best of street fashion. Haring’s iconic work captured the hearts of high and low art aficionados alike, and this famous series captures the essence of his style: Modele Avec Personnages (GZ100), Serpent (GZ102), Milles Pattes (GZ103) and Blanc sur Noir (GZ104).&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(2993, 'GZ102', 'Serpent', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 52, NULL, NULL, 3, 0, b'1', 0, 0, NULL, ' \n  Each of these Keith Haring watches snaps, crackles, and pops with the energy of 1980s New York. With irresistible designs and unexpected juxtapositions of colour--turquoise with avocado, apricot with bubblegum—they pulse to the rhythm of the streets. As exciting, original, and authentic as street-corner breakdancers, subway murals, and alley graffiti, these works attract attention like the best of street fashion. Haring’s iconic work captured the hearts of high and low art aficionados alike, and this famous series captures the essence of his style: Modele Avec Personnages (GZ100), Serpent (GZ102), Milles Pattes (GZ103) and Blanc sur Noir (GZ104).&nbsp;  \n', b'0', b'0', b'0');
