INSERT INTO `relojes` VALUES(3007, 'GZ105', 'Bergstrussli', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 5, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3008, 'GZ109', 'Voir', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 53, NULL, NULL, 5, 0, b'1', 0, 0, NULL, ' \n  Jean-Michel Folon’s three watches for Swatch, Le Temps (GZ108), Voir (GZ109) and Perspective (GZ106) possess the graphic, bold simplicity of his popular designs. Their blue plastic straps lead the eye to the dials, printed with scenes that walk a fine line between abstract and figurative forms, shaded with coloured-pencil blues, greens, yellows and occasional reds. Absent all numerals, the dials feature slender hour and minute hands in strong red, yellow and blue. Masterfully balanced in terms of formal composition, these three works are an open invitation to explore the artist’s illustrated, animated and creative perspective on contemporary urban life.&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3009, 'GZ108', 'Le Temps', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 53, NULL, NULL, 5, 0, b'1', 0, 0, NULL, ' \n  Jean-Michel Folon’s three watches for Swatch, Le Temps (GZ108), Voir (GZ109) and Perspective (GZ106) possess the graphic, bold simplicity of his popular designs. Their blue plastic straps lead the eye to the dials, printed with scenes that walk a fine line between abstract and figurative forms, shaded with coloured-pencil blues, greens, yellows and occasional reds. Absent all numerals, the dials feature slender hour and minute hands in strong red, yellow and blue. Masterfully balanced in terms of formal composition, these three works are an open invitation to explore the artist’s illustrated, animated and creative perspective on contemporary urban life.&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3010, 'GZ106', 'Perspective', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 53, NULL, NULL, 5, 0, b'1', 0, 0, NULL, ' \n  Jean-Michel Folon’s three watches for Swatch, Le Temps (GZ108), Voir (GZ109) and Perspective (GZ106) possess the graphic, bold simplicity of his popular designs. Their blue plastic straps lead the eye to the dials, printed with scenes that walk a fine line between abstract and figurative forms, shaded with coloured-pencil blues, greens, yellows and occasional reds. Absent all numerals, the dials feature slender hour and minute hands in strong red, yellow and blue. Masterfully balanced in terms of formal composition, these three works are an open invitation to explore the artist’s illustrated, animated and creative perspective on contemporary urban life.&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3011, 'GZ107', 'Rorrim 5', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 43, NULL, NULL, 6, 0, b'1', 0, 0, NULL, ' \n  \n Tadanori Yokoo’s energetic, sizzling design for Swatch is at once calligraphic and contemporary.&nbsp; Rorrim (GZ107) (mirror written backwards) references both traditional Japanese media (the special packaging includes a bamboo ink brush) and the characteristic condensation of urban, ad-like images that Yokoo reworks in his art. The bold, impulsive colours—red, black, goldenrod yellow, blue—are featured on the intensely kinetic, action-packed dial as well. In this powerful, elegant and reflective work, the artist has achieved a masterful balance of noise and silence, one the mirror image and complement of the other. \n  \n', b'0', b'0', b'0');
