INSERT INTO `relojes` VALUES(3020, 'PUFF6', 'Puff Desert', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 6, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3021, 'GZ110', 'Le Temps Ponctue', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 54, NULL, NULL, 6, 0, b'1', 0, 0, NULL, ' \n  Numinous and svelte, Pol Bury’s truly beautiful Swatch Art Special features dimly shining points of light on a black dial. Emblematic of the understated artist and his interest in scale and motion, this quiet, exquisite timepiece deftly references the sweep of time. Like a night sky stippled with stars, Le Temps Ponctue (GZ110) is dotted with light—bright pinpricks of white, which seem to glow against the cloaked, dark background. Cosmic in conception and execution, this work emanates a sense of mystery. With its simple, delicate design, it evokes sensations of stargazing, capturing something of the quiet and depth of space.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3022, 'GZ111', 'Deux Amoreux', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 55, NULL, NULL, 6, 0, b'1', 0, 0, NULL, ' \n  Two line-drawn figures join lips in the inky centre of this Swatch Art Special. Valerio Adami’s Deux Amoreux (GZ111), with their profiles sketched in white, could be silhouettes, lit by moonlight as they kiss in the dark. Romantic and expressive, this elegant black and white watch is irrepressibly immediate. It vibrates with the energy of the artist, from his lively, active lines to his signature, which lies scribbled across the length of the black plastic strap. White hour and minute hands point out the time around the passionate, gestural scene, a gentle reminder that life is short. An evocative and deeply felt piece of work.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3023, 'GZ401', 'La Devoreuse', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 56, NULL, NULL, 6, 0, b'1', 0, 0, NULL, ' \n  In his collaboration with Swatch the Belgian painter created La Devoreuse (GZ401), an unforgettably bold and powerful work. With his vivid colours, master strokes and signature forms, the noted abstract expressionist’s creation growls with barely-restrained intensity. Black lines part the space of the volcanic dial, where fierce and nevertheless whimsical lines suggest a creature with teeth and eyes yet manage to inhabit the realm of abstraction. White hands enhance the strong, silent contrast between the cardinal-red dial and the black plastic strap. Ferocious and fashionable, this work of art has both bark and bite.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3024, 'GX107', 'Bonaparte', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 6, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3025, 'GX106', 'Pompadour', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 6, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3026, 'GZ113', 'Oigol Oro', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 57, NULL, NULL, 7, 0, b'1', 0, 0, NULL, ' \n  Oigol Oro (GZ113) is a sophisticated work that is irresistibly stylish, rather like a witty, well-dressed guest at dinner. Subtly masculine, smart and with just enough flourish to bring out its simplicity, this collaborative effort with Swatch reveals the casual, faintly theatrical and decidedly masterful touch of the artist. The dial, which shows an image of a white-horned, black, devilish creature whose red trident indicates the time, is a classic reference to the legend of Faust. Drawn with thoughtful, ironic restraint, the dapper, appealing Mephisto at the centre has the elegance and dark fascination of the stage.  \n', b'0', b'0', b'0');
