INSERT INTO `relojes` VALUES(3036, 'GZ116', 'Hollywood Dream', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 8, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3037, 'PWZ100', 'Gu(h)rke', 1, '', '2012-06-04', '2012-06-04', 0, 0, 19, 49, NULL, NULL, 9, 0, b'1', 9999, 0, NULL, ' \n  \n Sculptural, shapely and unexpected, the artist’s three creations for Swatch are small-scale works of Pop Art. Hofkunst set the classic watch format aside and instead fashioned organic, eye-tricking, sculptural watches that look as if they are made out of food. \n Gu(h)rke (PWZ100) is a cool green, right down to the dial, inked to look like a moist, seeded slice of cucumber. Bonju(h)r (PWZ101) is a strip of bacon, cleverly curly and striped, fairly crisping at the wrist. Verdu(h)ra (PWZ102) is an abundant, glistening red, the dial cushioned inside a plump-looking bell pepper. Each piece’s title is a bit of multi-lingual wordplay, and the work is pure visual play. \n  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3038, 'PWZ101', 'Bonju(h)r', 1, '', '2012-06-04', '2012-06-04', 0, 0, 19, 49, NULL, NULL, 9, 0, b'1', 9999, 0, NULL, ' \n  \n Sculptural, shapely and unexpected, the artist’s three creations for Swatch are small-scale works of Pop Art. Hofkunst set the classic watch format aside and instead fashioned organic, eye-tricking, sculptural watches that look as if they are made out of food. \n Gu(h)rke (PWZ100) is a cool green, right down to the dial, inked to look like a moist, seeded slice of cucumber. Bonju(h)r (PWZ101) is a strip of bacon, cleverly curly and striped, fairly crisping at the wrist. Verdu(h)ra (PWZ102) is an abundant, glistening red, the dial cushioned inside a plump-looking bell pepper. Each piece’s title is a bit of multi-lingual wordplay, and the work is pure visual play. \n  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3039, 'PWZ102', 'Verdu(h)ra', 1, '', '2012-06-04', '2012-06-04', 0, 0, 19, 49, NULL, NULL, 9, 0, b'1', 9999, 0, NULL, ' \n  \n Sculptural, shapely and unexpected, the artist’s three creations for Swatch are small-scale works of Pop Art. Hofkunst set the classic watch format aside and instead fashioned organic, eye-tricking, sculptural watches that look as if they are made out of food. \n Gu(h)rke (PWZ100) is a cool green, right down to the dial, inked to look like a moist, seeded slice of cucumber. Bonju(h)r (PWZ101) is a strip of bacon, cleverly curly and striped, fairly crisping at the wrist. Verdu(h)ra (PWZ102) is an abundant, glistening red, the dial cushioned inside a plump-looking bell pepper. Each piece’s title is a bit of multi-lingual wordplay, and the work is pure visual play. \n  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3040, 'GZ117', 'Flaeck', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 58, NULL, NULL, 9, 0, b'1', 0, 0, NULL, ' \n  Flaek (GZ117), the artist’ design for Swatch, dances along the edge of the abstract and the figurative. With its print-like black and white forms, this eye-popping piece teases the viewer back and forth from images of dairy cows to formless floating shapes. Like Rorschach blots or camouflage, the images assemble and dissemble at once. Though the cow markings and meadow-green case slyly reference Switzerland, the overall effect is more modern art—colour patches detached from form and rearranged. The alert, poppy design has the best of both worlds, capturing both the musings of abstraction and the specific beauty of reference to the natural world.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3041, 'GZ118', 'Test', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 9, 0, b'1', 0, 0, NULL, ' \n  As fluid and evanescent as time itself, Silvie and Ch&eacute;rif Defraoui’s Horizon (GZ118) is a watery, flowing creation, printed with mysterious, inky gestalts that emerge from fields of cerulean and midnight blue. Like images assembling themselves from Rorschach blots, these beautiful forms are undetermined, undefined, and as open for interpretation as animal shapes discovered in the clouds. Depths and shallows, whole worlds and oceans of colour and time are contained in a work whose pen-and-ink elegance remains a mystery. A luminous, intellectual timepiece from the avant-garde of contemporary art.&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3042, 'GZ119', '360 Rosso Sur Blackout', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 61, NULL, NULL, 9, 0, b'1', 0, 0, NULL, ' \n  360&deg; Rosso Sur Blackout (GZ119) is simple and geometric, prompting the viewer to look closely for the meaning and mechanism concealed in its elegance. A precise, thin red line runs the length of the piece, otherwise rendered in gun-metal, dimly luminescent black and grey. Strapped to the wrist, the cardinal dividing line meets up with itself and forms a circle (360 degrees), a continuous ellipse of red. Placed flat on a surface, the red of the design yields a different composition, a play of still lines and the two red dots that mark the time. Intelligent and curiously pure, this watch has the beauty of a mathematical formula.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3043, 'GZ120', 'Wheel Animal', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 60, NULL, NULL, 9, 0, b'1', 0, 0, NULL, ' \n  Wheel Animal (GZ120) emanates from the quiet mind of this mysterious artist, whose serene minimalist design for Swatch is full of space. The piece centres on a corroded-looking, rust-eaten wheel with four spokes whose purpose seems hard to pin down. As the eye comes to rest on the quiet, deep image, grand ideas form in the mind—the history of timekeeping, or navigation by the light and position of stars. There is also something alive and creature-like about the wheel, suggested by the name and its organic quality. Its earthy colours and fragile form remind us that even the most complex machines come from the materials of the natural world.  \n', b'0', b'0', b'0');
