INSERT INTO `relojes` VALUES(3048, 'GZ123', 'Sam Francis', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 48, NULL, NULL, 10, 0, b'1', 0, 0, NULL, ' \n  Action-packed, gestural, full of drips and motion and the movement of paint across the canvas, Sam Francis’s (GZ123) eponymous collaboration with Swatch is an action painting on the wrist. The bold dial is a deep crimson with a saturated blue field of colour floating over black. The hands are red as well, and the strap features black shapes, aquamarine pools and red, yellow, blue and green splashes. Full of the presence of the artist’s hand and the evidence of time, one can almost feel the painting taking place on one’s wrist. Flexible and plastic with moments of transparency, this work is a true Art Special—special art in the form of a watch.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3049, 'GZ126', 'Swatch The People', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 10, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3050, 'GZ125', 'Chandelier', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 10, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3051, 'PWZ104', 'Orb', 1, '', '2012-06-04', '2012-06-04', 0, 0, 19, 42, NULL, NULL, 11, 0, b'1', 49999, 0, NULL, ' \n  The irrepressible, joyous vision of Vivienne Westwood delivers a dazzling, multi-part work for Swatch. Bursting with passion and originality, this series of Swatch watches ranges from the soft, romantic frippery of Putti (PWK168) to the rich and royally feminine Orb (PWZ104) and the bold, graphic Anglomania (GW134P), whose coiling red rope and nautical theme call to mind the fantasy of pirates on the high seas. Created in a variety of materials and special packaging, these unexpected accessories play with the colours of contrast and the spirit of rebellion, overturning the tea table of fashion history to create opulent, vivacious works of art. Portrait (SFK150), Flying Time (YLS415P), Seditionaries (YCS104P) and Cocotte (SUBK101P) show Vivienne Westwood discovering new facets of fashionable art for Swatch.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3052, 'PWZ106', 'Soupe De Poisson', 1, 'Not Numbered', '2012-06-04', '2012-06-04', 0, 0, 19, NULL, NULL, NULL, 11, 0, b'1', 49999, 0, NULL, '', b'0', b'0', b'0');
