INSERT INTO `relojes` VALUES(3057, 'GZ128', 'Eggsdream', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3059, 'SPGZS04', 'Rotella Set', 1, '', '2012-06-04', '2012-06-04', 0, 0, 41, 63, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3060, 'GZ132', 'Bengala', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 63, NULL, NULL, 12, 0, b'1', 0, 0, NULL, ' \n  Some like it hot, and everyone likes the ultimate icon of gloss and glamour. In his signature d&eacute;collage style, the intriguing Rotella takes on a larger-than-life Marilyn (GZ133), re-constructing and deconstructing her mythic pop persona. With its urban, vintage advertisement colours juxtaposed for punch and power, the work hums with the icon’s magnetic personality while exploring the places she came away at the seams. In Bengala (GZ132), a fierce creature snarls from the dial. Printed with nature’s catchy original design of black and orange stripes, this ferociously attractive piece meets the viewer’s gaze with a powerful eye.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3061, 'GZ133', 'Marilyn', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 63, NULL, NULL, 12, 0, b'1', 0, 0, NULL, ' \n  Some like it hot, and everyone likes the ultimate icon of gloss and glamour. In his signature d&eacute;collage style, the intriguing Rotella takes on a larger-than-life Marilyn (GZ133), re-constructing and deconstructing her mythic pop persona. With its urban, vintage advertisement colours juxtaposed for punch and power, the work hums with the icon’s magnetic personality while exploring the places she came away at the seams. In Bengala (GZ132), a fierce creature snarls from the dial. Printed with nature’s catchy original design of black and orange stripes, this ferociously attractive piece meets the viewer’s gaze with a powerful eye.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3062, 'SDZ101', 'C Monsta', 1, '', '2012-06-04', '2012-06-04', 0, 0, 11, NULL, NULL, NULL, 13, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3063, 'SCZ103', 'Unlimited', 1, '', '2012-06-04', '2012-06-04', 0, 0, 10, NULL, NULL, NULL, 13, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3064, 'GZ140', 'Xmas By Xian Lax', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 64, NULL, NULL, 12, 0, b'1', 0, 0, NULL, ' \n  It’s Lacroix, Darling. What to expect from a collaboration with Christian Lacroix (alias Xian Lax, derived from a phonetic spelling of his name) but a jewel-rich, garnet-red, gold-wrought work of art that says Swatch in the same breath as it says Lacroix? Ornate as a king’s regalia, Xian Lax’s Xmas (GZ140) presents a dial clasped in a pomegranate-red, translucent plastic body. The strap is elastic and assembled from cast brass segments. In place of hour and minute hands, a radiant, golden sun at the centre of the dial turns around 24 coloured crystals, indicating the preciousness of every hour and celebrating the ultimate timekeeper, the sun.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3065, 'GZ141', 'Eiga Shi', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 65, NULL, NULL, 13, 0, b'1', 0, 0, NULL, ' \n  The eye of the camera, the eye of God, the eye of the artist behind the camera. Themes of grand scope are suggested and peeked at through the teal, iris-like dial at the centre of Kurosawa’s Eiga-Shi (GZ141). Fringed with bronze- and silver-coloured rays that look like eyelashes, the dial is a small, intensely-hued blue-green circle set within the white circle of the watch face. Blue and flag-red run along the 12 and 6 o’clock sides of the strap, each with a neat clear line running lengthwise and dividing the fields of colour. Beautiful and simple, this watch by the master filmmaker is lyrical and full of mystery.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3066, 'YGG100', 'Renverse', 1, '', '2012-06-04', '2012-06-04', 0, 0, 42, NULL, NULL, NULL, 12, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3067, 'GZ143', 'Time To Reflect', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 66, NULL, NULL, 13, 0, b'1', 0, 0, NULL, ' \n  Simple, spare and handsome, the minimalist elegance of Robert Altman’s Swatch does indeed give one Time to Reflect (GZ143). Featuring nothing but these words, stylishly scripted across the minute and hour hands, the still, silvery dial offers a meditative reminder to take time for musing. The entire watch is done in a mutely luminous light grey, suggestive of mirrors and reflection as well as the classic palette of black and white films. Altman’s signature and the word-laden hour and minute hands emerge in black like titles from a cinema screen. Bare, clear, and thoughtful, this work speaks in a whisper with a look as classy as Altman’s movies.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3068, 'GZ142', 'Despiste', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, 67, NULL, NULL, 13, 0, b'1', 0, 0, NULL, ' \n  Despite (GZ142), the Swatch Art Special by Spanish filmmaker Pedro Almod&oacute;var, is a pretty, feminine watch, soaked with colour and elaborated with graceful flourishes. Executed in lightweight plastic, the design has something of both high Spanish Baroque and Art Deco. The dial features interlocking, swooping white patterns set against a green and red background. Generous feathers of bright blue sit within the white forms. The strap is set with mosaic-like beading that calls to mind some extravagant church floor or tiled Spanish courtyard. Despite offers a rich and decorated look perfumed with the style of an essential and vibrant artist.  \n', b'0', b'0', b'0');
