INSERT INTO `relojes` VALUES(3092, 'YGS705', 'Roasted Chestnut', 1, '', '2012-06-04', '2012-06-04', 0, 0, 42, NULL, NULL, NULL, 14, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3093, 'SLZ104', 'Zapping', 1, '', '2012-06-04', '2012-06-04', 0, 0, 24, 69, NULL, NULL, 13, 0, b'1', 0, 0, NULL, ' \n  Zapping (SLZ104) bristles with energy, buzzes with electricity, transpires, happens, zaps. With his television-colours and information-spangled design, the endlessly original Nam June Paik seems to be flipping through the channels along the length of the watch. He juxtaposes magnetically charged images, compressed bits of information zipping through the ether on waves of broadcast TV shows or Internet superhighways. Rendered with a jewel-clear chartreuse plastic case, a flexible strap as glossy as a magazine and an intense blue dial with a scrawled white design, Zapping is a clever, information-age timepiece, infused with the Zeitgeist of the 90s.  \n', b'0', b'0', b'0');
