INSERT INTO `relojes` VALUES(3104, 'PMZ105', 'Feathers', 1, '', '2012-06-04', '2012-06-04', 0, 0, 19, 70, NULL, NULL, 15, 0, b'1', 0, 0, NULL, ' \n  Feathers (PMZ105) is a dandy, dashing affair, outfitted with plumage that would make the handsomest bird of paradise green with envy. A grassy, intricately inked green and yellow dial peeks out from a sumptuous, overstuffed fan of dark apricot feathers. Red-orange minute, hour, and second hands amble fancifully around the hours of the day, pointing at different corners of the pillowy ring of plumes. With the scale and drama of catwalk haute couture, this enchanting, high-fashion work of art is posh, luxurious and as full of charms as a socialite making her debut. And with its captivating opulence, this piece is doubtless the belle of the ball.&nbsp;&nbsp;  \n', b'0', b'0', b'0');
