INSERT INTO `relojes` VALUES(3136, 'SBZ104', 'Wake Up', 1, '', '2012-06-04', '2012-06-04', 0, 0, 12, 72, NULL, NULL, 15, 0, b'1', 0, 0, NULL, ' \n  Spike Lee is a man with a message, a fact that is evidenced as much by his powerful films as it is by Wake Up (SBZ104), his forceful statement for Swatch. Unusually coloured in periwinkle, grey and gold with a touch of dark ocean blue, this watch features bold text in capital letters printed around the outsized dial, which itself contains multiple sub-dials within the main watch face. The text, printed in an eye-popping white font against gold, issues a call to wake up—to come to our senses, seize the day. A watch with a concept, this strong piece has the title embossed along the length of the strap for added emphasis.  \n', b'0', b'0', b'0');
