INSERT INTO `relojes` VALUES(3190, 'YBZ4000', 'Sea Counter (VIP)', 1, '', '2012-06-04', '2012-06-04', 0, 0, 49, NULL, NULL, NULL, 18, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3191, 'YGS724', 'Cool Days Light Blue', 1, '', '2012-06-04', '2012-06-04', 0, 0, 42, NULL, NULL, NULL, 20, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3192, 'GZ159', 'Jelly Piano', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 17, 0, b'1', 0, 0, NULL, ' \n  Jelly Piano (GZ159), the artist’s design for Swatch, is a celebration of the pure allure of watchwork machinery. Rendered in cool, collected transparencies that recall architect’s vellum, the work pulls the curtain back from the diminutive, fascinatingly precise mechanisms of timekeeping, offering the connoisseur a private viewing of the watch’s interior workings. Thus exposed, the works recall Piano’s own designs for the Beaubourg. As poised as the artist’s most celebrated structures, this urban and urbane work of art is reminiscent of sharpened pencils, rolls of blueprints and tiny cardboard models, traditional tools of the architect’s trade.&nbsp;  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3193, 'GZ161', 'La Sirene Et Le Marin', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 17, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3196, 'GZ163', 'Time Tranny', 1, '', '2012-06-04', '2012-06-04', 0, 0, 4, NULL, NULL, NULL, 18, 0, b'1', 0, 0, NULL, ' \n  LaChapelle’s creation for Swatch features a picture of the extravagant model and transsexual icon, Amanda Lepore. Surrounded by the blue and gold nimbus of a King Tut-like headdress, her face radiates a red-lipsticked smile. The strap is printed with various collaged images—a racy red car crash, a near-nude model. With all its red-nailed, performed femininity, this watch has as much going on as a fashion socialite, from the glitzy red, blue and gold palette to Lepore’s arched, flawlessly painted eyebrows. Humorously titled Time Tranny (GZ163), this irresistible piece is the delightful and surprising work from a provocative and edgy artist.  \n', b'0', b'0', b'0');
