INSERT INTO `relojes` VALUES(3218, 'SVAK1000', 'Diaphane One', 1, '', '2012-06-04', '2012-06-04', 0, 0, 62, NULL, NULL, NULL, 19, 0, b'0', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3219, 'SFK150P', 'Portrait', 1, '', '2012-06-04', '2012-06-04', 0, 0, 6, 42, NULL, NULL, 19, 0, b'0', 0, 0, NULL, ' \n  The irrepressible, joyous vision of Vivienne Westwood delivers a dazzling, multi-part work for Swatch. Bursting with passion and originality, this series of Swatch watches ranges from the soft, romantic frippery of Putti (PWK168) to the rich and royally feminine Orb (PWZ104) and the bold, graphic Anglomania (GW134P), whose coiling red rope and nautical theme call to mind the fantasy of pirates on the high seas. Created in a variety of materials and special packaging, these unexpected accessories play with the colours of contrast and the spirit of rebellion, overturning the tea table of fashion history to create opulent, vivacious works of art. Portrait (SFK150), Flying Time (YLS415P), Seditionaries (YCS104P) and Cocotte (SUBK101P) show Vivienne Westwood discovering new facets of fashionable art for Swatch.  \n', b'0', b'0', b'0');
