INSERT INTO `relojes` VALUES(3618, 'YOZ101', 'The Chest', 1, '', '2012-06-04', '2012-06-04', 0, 0, 88, NULL, NULL, NULL, 25, 0, b'1', 0, 0, 11, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3619, '9ITSCVK4036AG', 'Full Blooded', 1, '', '2012-06-04', '2012-06-04', 0, 0, 41, NULL, NULL, NULL, 25, 0, b'1', 0, 0, 11, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3620, 'GZ191', 'Once Again Again', 1, '', '2012-06-03', '2012-06-03', 0, 0, 4, NULL, NULL, NULL, 26, 0, b'1', 0, 0, 11, ' \n  Sexy, slim and self-aware, the super-chic and ultra-contemporary Once Again&nbsp; Again (GZ191), comes to us live from the advancing front lines of fashion and art. Joining rich concept with rich materials, it captures the intricacy of an information- and image-studded world. Two images of the watch dial are superimposed, blurring the dial like a camera veering out of focus. With its “come again?” quality, the design provides a visual echo of the history of printing, film and photography while merging two perspectives on time. Executed in black and white, Once Again, Again (GZ191), is the perfect balance of complex implications and simple design.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3621, 'GZ191A', 'Once Again Again (Special Munich)', 1, '', '2012-06-03', '2012-06-03', 0, 0, 4, NULL, NULL, NULL, 26, 0, b'1', 0, 0, 23, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3622, 'GZ191C', 'Once Again Again (Special Japan)', 1, '', '2012-06-03', '2012-06-03', 0, 0, 4, NULL, NULL, NULL, 26, 0, b'1', 0, 0, 23, ' \n  Sexy, slim and self-aware, the super-chic and ultra-contemporary Once Again&nbsp; Again (GZ191), comes to us live from the advancing front lines of fashion and art. Joining rich concept with rich materials, it captures the intricacy of an information- and image-studded world. Two images of the watch dial are superimposed, blurring the dial like a camera veering out of focus. With its “come again?” quality, the design provides a visual echo of the history of printing, film and photography while merging two perspectives on time. Executed in black and white, Once Again, Again (GZ191), is the perfect balance of complex implications and simple design.  \n', b'0', b'0', b'0');
