INSERT INTO `relojes` VALUES(3626, 'GZ196', 'Beautiful Women', 1, '', '2012-06-03', '2012-06-03', 0, 0, 4, NULL, NULL, NULL, 26, 0, b'1', 0, 0, 20, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3627, 'GZ197', 'Afreau Couti', 1, '', '2012-06-03', '2012-06-03', 0, 0, 4, NULL, NULL, NULL, 26, 0, b'1', 0, 0, 20, ' \n  The drawing printed on the strap and dial of Afreau Couti (GZ197) presents everyday life in an African landscape, with baobab trees and people talking, working, living together, going about their daily tasks. According to the artists, it’s inspired by traditional African and Pacific Islander drawings, although there is also a touch of the K&ouml;rner Union way of seeing. This delightful piece has a white-grounded print on its plastic strap, a red plastic buckle and loop and a polished red case. Brightly coloured elements of the design appear in relief on the white of the dial.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3628, 'GZ198', 'Graph Paper', 1, '', '2012-06-03', '2012-06-03', 0, 0, 4, NULL, NULL, NULL, 26, 0, b'1', 0, 0, 20, ' \n  Graph Paper (GZ198) is clean, minimalist and full of light. The fine gridwork is a reference to the sketchpads traditionally used by inventors, engineers and designers. McGrath transfers the abstract grids to the strap and dial, transforming them into an elegant homage to the process of design. The plastic strap shows the fine blue grid stretching from the white plastic buckle and loop to the white plastic case. The light blue grid extends across the entire surface of the dial. Clean, lean and gently ironic, McGrath’s Graph Paper (GZ198) debuted as part of Club’Art – The Graphics Collection by Swatch.  \n', b'0', b'0', b'0');
