INSERT INTO `relojes` VALUES(3930, 'ITAPACK4', 'Olympic Centennial Race', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, 12, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3932, 'SCK400PACK', '100 Years Cinema', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3934, 'GZ129PACK2', 'Red Collector Box', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, 11, ' \n  \n In 1994 the Club was known as “The Swatch Collectors of Swatch”, and that year’s Club Watch was designed with a special Collector in mind — one with a taste for precious stones and a sparkle in her eye. Her Gent is the colour of gemstones — dark green and lustrous blue the strap, with a loop the colour of pearls, transparent violet the case. And, on the dial, the Crystal Surprise that gives the Club Watch 1994 its name: a diamond (a real one!). \n  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3935, 'GZ136PACK', 'Dan Jansen', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, 12, '', b'0', b'0', b'0');
