INSERT INTO `relojes` VALUES(3941, 'SSK104PACK', 'Le Walk', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3942, 'SSK105PACK', 'Le Walk', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3943, 'SLR100PACK', 'Tadini T-Shirt', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, ' \n  Mendini’s work for Swatch evokes the breezy, maritime, sun-on-skin feeling of lounging at the beach—even when his design is of a cityscape. Rendered in sugar-frosting pinks and purples, sprinkled with beach-umbrella reds and yellows, and generally favouring a palette of tropical blue-greens and pastels, these deliciously relaxed and easy-going watches are impeccably designed. Each one is a unique and pleasant expression with a feeling all its own. Cosmesis (GM103), Metroscape (GN109), Lots of Dots (GZ121), Fandango (SLR100), and Mendini Tower (GZS02) are imbued with the effortless, casual, unhurried spirit of the designer’s style. Miami? The Riviera? Either way, it feels amazing.  \n', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3944, 'SLK104PACK2', 'Swatch LP', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3945, 'SBN101PACK', 'Aquachrono Soup USA', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3946, 'SBK100PACK', 'Aquachrono Soup Italy', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3947, 'VIPPACK1', 'Irony VIP Case', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 13, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3949, 'SWISSPACK2', 'Roller Inline', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 12, 0, b'1', 0, 0, NULL, '', b'0', b'0', b'0');
INSERT INTO `relojes` VALUES(3950, 'GK208PACK', 'Floppy Disk', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 13, 0, b'1', 0, 0, 13, ' \n  In Graphickers (GK208), Hajime Tachibana plays a clever melody on the keyboard of typography, using printed, stretched, coiled and distorted fonts as visual elements in the design. The strap is clear plastic, so that the type and words—“Swatch Graphickers”—pop against whatever background is placed behind the watch.&nbsp; The white dial is inked with an intricate, tangled design of black lines that almost look like traces of some object’s trajectory, a record of movement. Lines that curve and twist suggest shell-like, architecturally structured forms. The b&amp;w palette is perfect for this minimalist designer, whose urbane tastes define his point of view.&nbsp;  \n', b'0', b'0', b'0');
