INSERT INTO `relojes` VALUES(3979, 'GK206PACK', 'Framed Litho', 1, '', '2012-06-05', '2012-06-05', 0, 0, 41, NULL, NULL, NULL, 13, 0, b'1', 0, 0, 13, ' \n  Vive La Paix (GK206) is as sweet and lazy as a summer day. Painterly images of birds and the sun float in white on a deep azure strap like clouds passing across the sky.&nbsp; A brilliant and shimmering hue, the strap is rendered in signature Swatch plastic, with a clear plastic case around the dial. The dial, an easy field of cornflower blue, is empty of numbers except for a 3 at the right.&nbsp; To the left sits a friendly print of a hen in the sun, a warm scene from a country farmyard. This Swatch Art Special from Dutch artist Corneille seems made of whimsy and summer, the perfect complement to a dreamy afternoon.&nbsp;  \n', b'0', b'0', b'0');
