INSERT INTO `relojes` VALUES(4124, 'GZ159PACK', 'Back to School Set', 1, '', '2012-06-06', '2012-06-06', 0, 0, 41, NULL, NULL, NULL, 18, 0, b'1', 0, 0, NULL, ' \n  Jelly Piano (GZ159), the artist’s design for Swatch, is a celebration of the pure allure of watchwork machinery. Rendered in cool, collected transparencies that recall architect’s vellum, the work pulls the curtain back from the diminutive, fascinatingly precise mechanisms of timekeeping, offering the connoisseur a private viewing of the watch’s interior workings. Thus exposed, the works recall Piano’s own designs for the Beaubourg. As poised as the artist’s most celebrated structures, this urban and urbane work of art is reminiscent of sharpened pencils, rolls of blueprints and tiny cardboard models, traditional tools of the architect’s trade.&nbsp;  \n', b'0', b'0', b'0');
